import React, { Component } from "react";
import { Layout, Button, Modal } from "antd";
import { UserOutlined } from "@ant-design/icons";
import Boxmenuber2 from "../../containers/Member/Add/box-memuber-2";
import Boxmenuber3 from "../../containers/Member/Add/box-memuber-3";
import Backmenuber from "../../containers/Member/Add/back-menu";
import styled from "styled-components";
import { Row, Col, Form, Input, DatePicker, Radio, Select } from "antd";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { library } from "@fortawesome/fontawesome-svg-core";
import {
  fab,
  faLine,
  faFacebookSquare,
} from "@fortawesome/free-brands-svg-icons";

const { Header, Content } = Layout;
const { confirm } = Modal;
function showConfirm() {
  confirm({
    okText: "ใช่",
    cancelText: "ไม่ใช่",
    title: (
      <c style={{ fontFamily: "DB Adman X", fontSize: "3ch" }}>
        สมัครสมาชิกสหกรณ์
      </c>
    ),
    icon: <UserOutlined />,
    content: (
      <c style={{ fontFamily: "DB Adman X", fontSize: "2.8ch" }}>
        คุณต้องการบันทึกข้อมูลหรือไม่
      </c>
    ),
    onOk() {
      return new Promise((resolve, reject) => {
        setTimeout(Math.random() > 0.5 ? resolve : reject, 1000);
      }).catch(() => console.log("Oops errors!"));
    },
    onCancel() {},
  });
}

library.add(fab);

const style = { padding: "10x 0px " };

const { Option } = Select;

function onChange(date, dateString) {
  console.log(date, dateString);
}

class RegisterPage extends Component {
  constructor(props) {
    super(props);
    this.idEl = React.createRef();
    this.passwordEl = React.createRef();
  }

  submitHandler = (event) => {
    event.preventDefault();
    const id = this.idEl.current.value;
    const password = this.passwordEl.current.value;

    if (id.trim().length === 0 || password.trim().length === 0) {
      return;
    }

    let requestBody = {
      query: `
      mutation {
        createUser(userInput: {id: "${id}", password: "${password}"}) {
          _id
          id
        }
      }
      `,
    };

    fetch("http://localhost:8000/graphql", {
      method: "POST",
      body: JSON.stringify(requestBody),
      headers: {
        "Content-Type": "application/json",
      },
    })
      .then((res) => {
